import React from 'react';
import './Home.css';
import Data from '../data';
import MenuItem from '../MenuItem';
const Home = () => {
  return (
    <div className='container'>
      <h3 className='heading'>Menu</h3>
      {Data.map((data) => {
        return (
          <MenuItem image={data.image} title={data.title} link={data.link} />
        );
      })}
    </div>
  );
};

export default Home;
